    true,nt"url": null,nt"notes": "ML2DGG is the EOS Aura Microwave Limb Sounder
    (MLS) product containing geophysical diagnostic quantities pertaining directly to
    the standard geophysical data products, generally on a similar (or identical) grid,
    and at different spectral ranges. The current version is 4.2. Data coverage is complete
    from August 8, 2004 to current. Spatial coverage is near-global (-82 deg. to +82
    deg. latitude), with each profile spaced 1.5 deg. or ~165 km along the orbit track
    (roughly 15 orbits per day). Vertical resolution varies between species and typically
    ranges from 3 - 6 km. Users of the ML2DGG data product should read the EOS MLS Level
    2 Version 4 Quality Document for more information (http://mls.jpl.nasa.gov/data/v4-2_data_quality_document.pdf).nn
         Users are encouraged to register with the MLS science team at https://mls.jpl.nasa.gov/forms/reguser.php
    to obtain updates and information about this data product.nn      The data are stored
    in the version 5 EOS Hierarchical Data Format (HDF-EOS5), which is based on the
    version 5 Hierarchical Data Format, or HDF5. Each file contain swaths objects for
    each diagnostics measurement. Each swath has a set of data and geolocation fields,
    swath attributes, and metadata. The data fields include the geophysical parameter
    values and precision (standard deviation), convergence values, data quality, and
    a status flag. The geolocation fields include a time stamp in TAI-93 format (seconds
    since January 1, 1993), geodetic latitude and longitude, and pressure level values,
    as well as local solar time, solar zenith angle, line of sight angle, and orbit
    geodetic angle. There is one file per day.",nt"license_title": "U.S. Government
